var LIVERELOAD_HOST="localhost:",LIVERELOAD_PORT=35729,connection=new WebSocket("ws://"+LIVERELOAD_HOST+LIVERELOAD_PORT+"/livereload");connection.onerror=function(e){console.log("reload connection got error"+JSON.stringify(e))},connection.onmessage=function(e){if(e.data){var t=JSON.parse(e.data);t&&t.command==="reload"&&chrome.runtime.reload()}};